import React from "react";
import Room from "./Room";
export default function RoomList({ rooms }) {
  if (rooms.length === 0) {
    return (
      <div className="empty-search">
        <h3>No matching rooms</h3>
      </div>
    );
  }
  return <div>Hello</div>;
}
